const aiData = $('AI Agent').first().json;

// Handle both shapes: [ { output: [...] } ] or { output: [...] }
const input = Array.isArray(aiData) ? aiData[0].output : aiData.output;

// Parse if it's a string
const quizData = typeof input === 'string' ? JSON.parse(input) : input;

// Validate structure
if (!Array.isArray(quizData)) {
  throw new Error("Expected quizData to be an array, got: " + typeof quizData);
}

// ? Dynamic title
const title = $('JotForm Trigger').first().json.q7_quizName || "Auto-Generated Quiz";

const body = {
  "properties[title]": title,

};

// ? Title centered and styled
body["properties[title]"] = title;
body["properties[titleAlign]"] = "center";
body["properties[fontFamily]"] = "Inter";
body["properties[fontColor]"] = "#222222";

// ? General form styling
body["properties[backgroundColor]"] = "#f0f4f8";
body["properties[formWidth]"] = "800";
body["properties[formAlign]"] = "center";
body["properties[formPadding]"] = "40";
body["properties[questionSpacing]"] = "25";

// ? Label styling (questions)
body["properties[labelAlign]"] = "top";
body["properties[labelWidth]"] = "100%";
body["properties[labelFontSize]"] = "18";

// ? Option styling (makes radio options display in two columns)
body["properties[inputTextAlignment]"] = "left";
body["properties[columns]"] = "2";
body["properties[radioArrangement]"] = "spread";  // spreads options evenly in 2 columns

// ? Button styling
body["properties[buttonBackgroundColor]"] = "#007bff";
body["properties[buttonFontColor]"] = "#ffffff";

// ? Add quiz questions
quizData.forEach((item, index) => {
  const qIndex = index + 1; // shift by 1 since 0 is the heading
  const formattedOptions = (item.options || []).map(opt => opt.trim()).join('|');

  body[`questions[${qIndex}][type]`] = "control_radio";
  body[`questions[${qIndex}][text]`] = item.question?.trim() || "";
  body[`questions[${qIndex}][options]`] = formattedOptions;
  body[`questions[${qIndex}][correct_option]`] = item.correct_option?.trim() || "";
});

return [{ json: body }];
